import React, { Component } from "react";
import Blog from "../Blog";
import Main_Data from "../../../Data/Blog_data";

export default class Main_Blog extends Component {
  render() {
    console.log(Main_Data)
    return (
      <div>
          <Blog
            image={require("../image-1.jpg")}
            heading="React js 2024 New fwtures"
            peragraph="React is a free and open-source front-end JavaScript library for building user interfaces based on components. It is maintained by Meta and a community of individual developers and companies."
          ></Blog>
      </div>
    );
  }
}
